import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ImageList from '@material-ui/core/ImageList';
import ImageListItem from '@material-ui/core/ImageListItem';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';

import BackNextBtn from '../buttons/BackNextBtn';

const getImageData = () => [
  {
    id: 1, // id from database
    // FOR NOW TO DISPLAY CONTENT (base64 string)
    src: 'data:image/png;base64,',
  },
  {
    id: 2,
    src: 'data:image/png;base64,',
  },
  {
    id: 3,
    src: 'data:image/png;base64,',
  },
  {
    id: 4,
    src: 'data:image/png;base64,',
  },
  {
    id: 5,
    src: 'data:image/png;base64,',
  },
  {
    id: 6,
    src: 'data:image/png;base64,',
  },
  {
    id: 7,
    src: 'data:image/png;base64,',
  },
  {
    id: 8,
    src: 'data:image/png;base64,',
  },
  {
    id: 9,
    src: 'data:image/png;base64,',
  },
  {
    id: 10,
    src: 'data:image/png;base64,',
  },
  {
    id: 11,
    src: 'data:image/png;base64,',
  },
  {
    id: 12,
    src: 'data:image/png;base64,',
  },
];

const useStyles = makeStyles({
  selected: {
    borderWidth: '3px',
    borderColor: 'white',
    borderStyle: 'solid',
  },
  notSelected: {
    opacity: '0.7',
  },
});

const AvatarChooser = ({ next, back, avatar, saveAvatar }) => {
  // keeps id of currently selected avatar
  const [currentlySelected, setCurrentlySelected] = useState(avatar);
  const classes = useStyles();
  const imageData = getImageData();
  // styling for currently not selected items
  const notSelectedStyle = currentlySelected ? classes.notSelected : null;

  const onSelect = (id) => {
    setCurrentlySelected(id);
  };

  const onNext = () => {
    saveAvatar(currentlySelected);
    next();
  };

  const onBack = () => {
    saveAvatar(currentlySelected);
    back();
  };

  return (
    <Container maxWidth="sm">
      <ImageList rowHeight={140} cols={4} gap={8}>
        {imageData.map((item) => (
          <ImageListItem
            key={item.id}
            cols={1}
            onClick={() => onSelect(item.id)}
            className={
              item.id === currentlySelected
                ? classes.selected
                : notSelectedStyle
            }
          >
            <img src={item.src} alt={item.id} />
          </ImageListItem>
        ))}
      </ImageList>
      <Grid
        container
        direction="row"
        justifyContent="space-between"
        alignItems="center"
        style={{ marginTop: '40px' }}
      >
        <BackNextBtn variant="back" onClick={onBack}>
          Back
        </BackNextBtn>
        <BackNextBtn
          variant="next"
          disabled={!currentlySelected}
          onClick={onNext}
        >
          Next
        </BackNextBtn>
      </Grid>
    </Container>
  );
};

export default AvatarChooser;
